                    k += 1

                # Update the subsegment boundaries
                i = i + (n_zeros + 1) // 2
                j = j + (n_zeros + 1) // 2

                # Update the number of zeros in the subsegment
                n_zeros = 0

            # If there are no zeros in the current subsegment
