        elif rank[root_u] > rank[root_v]:
            parent[root_v] = root_u
        else:
            parent[root_v] = root_u
            rank[root_u] += 1
        return True

    def k_dist(u, v):
        dist = 0
        while u!= v:
            dist += 1
            u = find(parent[u])
            v = find(parent[v])
        return dist

    def max_weight(u):
        if u == -1:
