        return 0 <= i < N and 0 <= j < M

    def is_safe(i, j):
        return maria[i][j]!= '1'

    def get_neighbors(i, j):
        neighbors = [(i-1, j), (i+1, j), (i, j-1), (i, j+1)]
        neighbors = [n for n in neighbors if is_valid(n[0], n[1])]
        return neighbors

    def get_valid_neighbors(i, j):
        neighbors = get_neighbors(i, j)
        valid_neighbors = [(n[0], n[1]) for n in neighbors if is_safe(n[0], n[1])]
        return valid_neighbors

    def get_valid_neighbor_dirs(i, j):
        neighbors = get_neighbors(i, j)
        valid_neighbors = [(n[0], n[1]) for n in neighbors if is_safe(n[0], n[1])]
        neighbor_dirs = {}
        for n in valid_neighbors:
            d = (n[0]-i, n[1]-j)
            if d[0] == -1:
                neighbor_dirs['U'] = True
            elif d[0] == 1:
                neighbor_dirs['D'] = True
            elif d[1] == -1:
                neighbor_dirs['L'] = True
            elif d[1] == 1:
                neighbor_dirs['R'] = True
        return neighbor_dirs

    def get_shortest_path_length(start_i, start_j, goal_i, goal_j):
        # Breadth-first search
        queue = [(start_i, start_j, 0)]
        visited = set()
        while queue:
            i, j, length = queue.pop(0)
            if (i, j) == (goal_i, goal_j):
                return length
            if (i, j) in visited:
                continue
            visited.add((i, j))
            for ni, nj in get_neighbors(i, j):
                if (ni, nj) not in visited and is_safe(ni, nj):
                    queue.append((ni, nj, length+1))
        return None

    # Find Eren's starting position
    for i in range(N):
        for j in range(M):
            if maria[i][j] == 'S':
                start_i, start_j = i, j

    # Check if it is possible to escape
    if not is_safe(start_i, start_j):
        return "NOT POSSIBLE"

    # Check if Eren can escape before titans arrive
    if get_shortest_path_length(start_i, start_j, 0, 0) <= t:
        return "0"

    # Perform BFS to find the shortest path to escape
    queue = [(start_i, start_j, 0, 1)]
