    plaintext = stdin.split('\n')[1]

    # Remove spaces and duplicates from key phrase
    key_phrase = ''.join(sorted(set(key_phrase.replace(' ', ''))))

    # Generate encryption key
    table = [['' for j in range(5)] for i in range(5)]
    for i, letter in enumerate(key_phrase):
        table[i // 5][i % 5] = letter

    # Fill remaining letters of table
    for i in range(5):
        for j in range(5):
            if table[i][j] == '':
                for letter in 'ABCDEFGHIJKLMNOPQRSTUVWXYZ':
                    if letter not in key_phrase:
                        table[i][j] = letter
                        break

    # Encrypt plaintext
    ciphertext = ''
    for i in range(0, len(plaintext), 2):
        if i + 1 < len(plaintext) and plaintext[i] == 'x' and plaintext[i+1] == 'x':
            ciphertext += 'x'
            i += 2
        else:
            pair = plaintext[i:i+2]
            if pair[0] == pair[1]:
                pair = pair[0] + 'X'
            for j in range(5):
                for k in range(5):
                    if table[j][k] == pair[0]:
                        r, c = j, k
                        break
            if r == c:
                ciphertext += table[r][(c+1)%5] + table[r][(c+2)%5]
            elif table[r][(c+1)%5] == pair[1]:
                ciphertext += table[r][c+1]
            elif table[c][r] == pair[1]:
                ciphertext += table[r][c]
            else:
                ciphertext += table[r][c] + table[c][r]

    return ciphertext

